import React, { useState } from 'react';
import { Link, Route, Routes } from 'react-router-dom';
import Classes from './Classes';
import Courses from './Courses';
import Monitoring from './Monitoring';
import Rating from './Rating';
import Reports from './Reports';
import Lectures from './Lectures'; // Import the Lectures component

const PLDashboard = () => {
  const [sidebarOpen, setSidebarOpen] = useState(false);

  return (
    <div
      style={{
        display: 'flex',
        minHeight: '100vh',
        fontFamily: 'Arial, sans-serif',
        backgroundColor: '#ffefd5', // main background
        position: 'relative'
      }}
    >
      {/* Sidebar */}
      <nav
        style={{
          minHeight: '100vh',
          width: sidebarOpen ? '250px' : '200px',
          transition: 'width 0.3s',
          backgroundColor: '#969da5ff', // sidebar color
          boxShadow: '2px 0 5px rgba(0,0,0,0.1)',
          padding: '10px'
        }}
      >
        <button
          onClick={() => setSidebarOpen(!sidebarOpen)}
          style={{
            width: '100%',
            padding: '8px',
            border: 'none',
            borderRadius: '4px',
            backgroundColor: '#ffffff',
            color: '#007bff',
            fontWeight: 'bold',
            cursor: 'pointer',
            marginBottom: '10px'
          }}
        >
          {sidebarOpen ? '<< Collapse' : '>> Expand'}
        </button>
        <ul style={{ listStyle: 'none', padding: 0 }}>
          {[
            { to: '/pl/dashboard/classes', label: 'Classes' },
            { to: '/pl/dashboard/courses', label: 'Courses' },
            { to: '/pl/dashboard/monitoring', label: 'Monitoring' },
            { to: '/pl/dashboard/rating', label: 'Rating' },
            { to: '/pl/dashboard/reports', label: 'Reports' },
            { to: '/pl/dashboard/lectures', label: 'Lectures' }, // Added Lectures link
          ].map((item, index) => (
            <li key={index} style={{ marginBottom: '15px' }}>
              <Link
                to={item.to}
                style={{
                  display: 'block',
                  padding: '10px 15px',
                  color: '#fff',
                  textDecoration: 'underline', // underline style
                  borderRadius: '4px',
                  transition: 'background-color 0.2s'
                }}
                onMouseOver={(e) => (e.target.style.backgroundColor = 'rgba(255,255,255,0.2)')}
                onMouseOut={(e) => (e.target.style.backgroundColor = 'transparent')}
              >
                {item.label}
              </Link>
            </li>
          ))}
        </ul>
      </nav>

      {/* Main Content */}
      <main
        style={{
          flex: 1,
          backgroundColor: '#ffefd5',
          padding: '20px',
          position: 'relative', // for overlay
          marginLeft: sidebarOpen ? '250px' : '200px',
          transition: 'margin-left 0.3s'
        }}
      >
        {/* Logout Button in top right corner (green) */}
        <button
          style={{
            position: 'absolute',
            top: '10px',
            right: '20px',
            backgroundColor: 'green',
            color: '#fff',
            padding: '10px 20px',
            border: 'none',
            borderRadius: '4px',
            cursor: 'pointer',
            textDecoration: 'underline',
            fontWeight: 'bold'
          }}
          onClick={() => {
            // Implement logout logic here
            localStorage.removeItem('token');
            window.location.href = '/login';
          }}
        >
          Logout
        </button>

        {/* Header */}
        <div
          style={{
            backgroundColor: '#b0c4de',
            padding: '20px',
            borderRadius: '4px',
            marginBottom: '20px',
            border: '1px solid #ffefd5'
          }}
        >
          <h2 style={{ margin: 0, textDecoration: 'underline' }}>Program Leader</h2>
        </div>

        {/* Content Routes */}
        <div style={{ backgroundColor: '#ffefd5', padding: '20px', borderRadius: '4px' }}>
          <Routes>
            <Route path="classes" element={<Classes />} />
            <Route path="courses" element={<Courses />} />
            <Route path="monitoring" element={<Monitoring />} />
            <Route path="rating" element={<Rating />} />
            <Route path="reports" element={<Reports />} />
            <Route path="lectures" element={<Lectures />} /> {/* New route */}
          </Routes>
        </div>
      </main>
    </div>
  );
};

export default PLDashboard;
